import React, { useEffect, useState } from "react";
import data from "./project.json";
import Header from "../../components/Header";
import "./index.scss";

const App = () => {
  const [projectList, setProjectList] = useState();
  useEffect(() => {
    console.log(data);
    setProjectList(data.projectCheckLists);
  }, []);

  return (
    <div>
      <Header />
    </div>
  );
};

export default App;
